import './App.css';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';

// Rajouter les différents fichier JS
import TopMangas from './Top10Mangas.js';
import TopAuteurs from './Top10Auteurs.js';
import ListeTests from './ListeTests.js';
//import FicheManga from './FicheManga';

function App() {
  return (
    <Router>
      <Switch>
        <Route path="/topmangas" exact>
          <TopMangas />
        </Route>
        <Route path="/topauteurs" exact>
          <TopMangas />
        </Route>
        <Route path="/test" exact>
          <ListeTests />
        </Route>
      </Switch>
    </Router>
  );
   
}

export default App;
